X: str = (
    "data:image/png;base64,"
)

Exe: str = (
    "data:image/png;base64,"
)

SomaliWare: str = (
    " data:image/jpeg;base64,"
)


class Images:
    """Images class to easily retrieve images in their base64 web format."""

    @staticmethod
    def get_image(value: str) -> str:
        """Gets a provided image

        Args:
            value (str): Name of an image

        Returns:
            str: Image
        """
        image_mapping = {"SomaliWare": SomaliWare, "exe": Exe}
        if value in image_mapping:
            return image_mapping[value]
        else:
            return X
